void print(struct my_double _X)
{
    u_ll _sign, _exp, _frac, _type;
    _type = is_special(_X);
    _sign = find_sign(_X);
    _exp = find_exp(_X);
    _frac = find_frac(_X);
    if(_type == _is_nan)
    {
        puts("nan");
        return ;
    }
    if(_sign)
        putchar('-');
    if(_type == _is_inf)
    {
        puts("inf");
        return ;
    }
    _sign=0;
    _X = make_my_double(_sign, _exp, _frac);
    int flag = 1;
    if(comp_my_double(_X,pos_pow10[max_ten_exp][max_ten_frac]))
        putchar('0'+max_ten_frac),flag = 0;
    for(int i = max_ten_exp - 1;i >= 0; i--)
        for(int j = bit_len-1;j > 0; j--)
        {
            if(comp_my_double(_X, pos_pow10[i][j]))
            {
                flag = 0;
                putchar('0' + j);
                _X=minus_my_double(_X, pos_pow10[i][j]);
                break;
            }
            if(j == 1 && flag == 0)
                putchar('0');
        }
    
    if(flag)
        putchar('0');
    if(is_special(_X)==_is_zero)
        return;
    putchar('.');
    for(int i = 1;i < min_ten_exp;i++)
        for(int j = bit_len-1;j >= 0; j--)
            if(comp_my_double(_X,neg_pow10[i][j]))
            {
                _X = minus_my_double(_X,neg_pow10[i][j]);
                putchar('0' + j);
                break;
            }
    // printf("\n");
}
struct my_double get_my_double()
{
    u_ll _sign=0,_exp=0,_frac=0;
    char c=getchar();
    if(c=='-')
        _sign=1;
    struct my_double _ans=make_my_double(_sign,_exp,_frac);
    while(c<'0'||c>'9')
        c=getchar();
    while(c>='0'&&c<='9')
    {
        _ans=times_my_double(_ans,_ten);
        _ans=add_my_double(_ans,pos_pow10[0][c-'0']);
        c=getchar();
    }
    if(c=='.')
    {
        c=getchar();
        int i=1;
        while(c>='0'&&c<='9')
        {
            _ans=add_my_double(_ans,neg_pow10[i][c-'0']);
            c=getchar();
            ++i;
        }
    }
    if(_sign)
        _ans._bitset[num_of_bytes-1]|=(1<<(len_of_bytes-1));
    ungetc(c,stdin);
    return _ans;

}

char sta_char[100010];
struct my_double sta_double[100010];
int pnt_char,pnt_double;

struct my_double calculate(struct my_double a,struct my_double b,char op)
{
    struct my_double _ans;
    if(op=='+')  _ans = add_my_double(a,b);
    if(op=='-')  _ans = minus_my_double(a,b);
    if(op=='*')  _ans = times_my_double(a,b);
    if(op=='/')  _ans = divide_my_double(a,b);
    return _ans;
}

bool input()
{
    char pre='(',c;
    while(1)
    {
        c=getchar();
        if(c==' ')
            continue;
        if(c==EOF || c=='\n' || c=='\r')
            break;
        if(!pre)
        {
            if(c==')')
            {
                while(sta_char[pnt_char]!='(')
                {
                    sta_double[pnt_double-1] = calculate(sta_double[pnt_double-1],sta_double[pnt_double],sta_char[pnt_char]);
                    --pnt_double;
                    --pnt_char;
                }
                --pnt_char;
                pre = 0;
                continue;
            }
            if(c=='+'||c=='-')
            {
                while(sta_char[pnt_char]!='(' && pnt_char)
                {
                    sta_double[pnt_double-1] = calculate(sta_double[pnt_double-1],sta_double[pnt_double],sta_char[pnt_char]);
                    --pnt_double;
                    --pnt_char;
                }
                sta_char[++pnt_char] = c;
                pre = c;
                continue;
            }
            if(c=='*'||c=='/')
            {
                while(sta_char[pnt_char]!='('  && sta_char[pnt_char]!='-' && sta_char[pnt_char]!='+' && pnt_char)
                {
                    sta_double[pnt_double-1] = calculate(sta_double[pnt_double-1],sta_double[pnt_double],sta_char[pnt_char]);
                    --pnt_double;
                    --pnt_char;
                }
                sta_char[++pnt_char] = c;
                pre = c;
                continue;
            }
            if(c=='(')
            {
                sta_char[++pnt_char] = c;
                pre = c;
                continue;
            }
        }
        if(pre)
        {
            if(c=='(')
            {
                sta_char[++pnt_char] = '(';
                pre = c;
                continue;
            }
            ungetc(c,stdin);
            sta_double[++pnt_double] = get_my_double();
            pre = 0;
            continue;
        }
    }
    while(pnt_char)
    {
        sta_double[pnt_double-1] = calculate(sta_double[pnt_double-1],sta_double[pnt_double],sta_char[pnt_char]);
        --pnt_double;
        --pnt_char;
    }
    print(sta_double[1]);
    pnt_double = 0;
    return 1;
}
